import React from 'react';

const EllaLogoIcon = ({ className, width = 21.73, height = 22 }) => (
  <svg 
    className={`ella-logo-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 22 22"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="11" cy="11" r="9" fill="currentColor" stroke="currentColor" strokeWidth="2"/>
    <path d="M7 11h8M11 7v8" stroke="white" strokeWidth="2" strokeLinecap="round"/>
  </svg>
);

export default EllaLogoIcon;
